choices.text:
if (seed != null) {
	InputStream inputStream = seed.getInputStream();
	rnd.setSeed(FileCopyUtils.copyToByteArray(inputStream));
}
else {
	rnd.nextBytes(new byte[1]);
}

if (seed == null) {
	rnd.nextBytes(new byte[1]);
}
else {
	InputStream inputStream = seed.getInputStream();
	byte[] bytes = FileCopyUtils.copyToByteArray(inputStream);
	if(bytes.length != 0) {
		rnd.setSeed(bytes);
	}
}

